    If no such a value exist, return -1.
    Examples:
        search([4, 1, 2, 2, 3, 1]) == 2
        search([1, 2, 2, 3, 3, 3, 4, 4, 4]) == 3
        search([5, 5, 4, 4, 4]) == -1
    '''
    if len(lst) == 0:
        return -1
    if len(lst) == 1:
        return lst[0]
    if len(lst) == 2:
        return lst[1]
    if len(lst) == 3:
        return lst[2]
    if len(lst) == 4:
        return lst[3]
    if len(lst) == 5:
        return lst[4]
    if len(lst) == 6:
        return lst[5]
    return -1

